		body {
			font-family: sans-serif;
			margin: 0;
			padding: 0;
			height: 100vh;
			display: flex;
			justify-content: center;
			align-items: center;
			background-color: #f9f9f9;
		}

		.container {
			text-align: center;
			margin-bottom: 80px;
		}

		h1 {
			margin-bottom: 20px;
			font-size: 36px;
			font-weight: bold;
		}

		form {
			display: inline-block;
		}

		.search-container {
			display: flex;
			align-items: center;
			justify-content: center;
			border-radius: 999px;
			padding: 10px;
			box-shadow: 0px 5px 15px rgba(0, 0, 0, 0.1);
			gap: 10px;
			margin-bottom: 20px;
		}

		#error-message {
			color: red;
			font-size: 0.9em;
		}

		input[type="text"] {
			width: 300px;
			padding: 10px;
			border: none;
			outline: none;
			font-size: 18px;
			border-radius: 999px;
			background-color: rgba(0, 0, 0, 0.05);
		}

		button[type="submit"] {
			background-color: rgb(254 40 150);
			color: white;
			border: none;
			padding: 10px 20px;
			font-size: 18px;
			border-radius: 999px;
			cursor: pointer;
		}
	</style>

			const phoneRegex = /^\d{10}$/;
